insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('1','1000','ENTRADAS OU AQUISIÇÕES DE SERVIÇOS DO ESTADO','Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado na mesma unidade da Federação do destinatário');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('2','1100','COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS','');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('3','1101','Compra para industrialização','Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('4','1102','Compra para comercialização','Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('5','1111','Compra para industrialização de mercadoria recebida anteriormente em consignação industrial','Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('6','1113','Compra para comercialização, de mercadoria recebida anteriormente em consignação mercantil','Classificam-se neste código as compras efetivas de mercadorias recebidas anteriormente a título de consignação mercantil.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('7','1116','Compra para industrialização originada de encomenda para recebimento futuro','Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('8','1117','Compra para comercialização originada de encomenda para recebimento futuro','Classificam-se neste código as compras de mercadorias a serem comercializadas, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('9','1118','Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem','Classificam-se neste código as compras de mercadorias já comercializadas, que, sem transitar pelo estabelecimento do adquirente originário, sejam entregues pelo vendedor remetente diretamente ao destinatário, em operação de venda à ordem, cuja venda seja classificada, pelo adquirente originário, no código 5.120 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('10','1120','Compra para industrialização, em venda à ordem, já recebida do vendedor remetente','Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, em vendas à ordem, já recebidas do vendedor remetente, por ordem do adquirente originário.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('11','1121','Compra para comercialização, em venda à ordem, já recebida do vendedor remetente','Classificam-se neste código as compras de mercadorias a serem comercializadas, em vendas à ordem, já recebidas do vendedor remetente por ordem do adquirente originário.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('12','1122','Compra para industrialização em que a mercadoria foi remetida pelo fornecedor ao industrializador sem transitar pelo estabelecimento adquirente','Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, remetidas pelo fornecedor para o industrializador sem que a mercadoria tenha transitado pelo estabelecimento do adquirente.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('13','1124','Industrialização efetuada por outra empresa','Classificam-se neste código as entradas de mercadorias industrializadas por terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 1.551 - Compra de bem para o ativo imobilizado ou 1.556 - Compra de material para uso ou consumo.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('14','1125','Industrialização efetuada por outra empresa quando a mercadoria remetida para utilização no processo de industrialização não transitou pelo estabelecimento adquirente da mercadoria','Classificam-se neste código as entradas de mercadorias industrializadas por outras empresas, em que as mercadorias remetidas para utilização no processo de industrialização não transitaram pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 1.551 - Compra de bem para o ativo imobilizado ou 1.556 - Compra de material para uso ou consumo.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('15','1126','Compra para utilização na prestação de serviço','Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('16','1150','TRANSFERÊNCIAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS','');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('17','1151','Transferência para industrialização','Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas em processo de industrialização.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('18','1152','Transferência para comercialização','Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('19','1153','Transferência de energia elétrica para distribuição','Classificam-se neste código as entradas de energia elétrica recebida em transferência de outro estabelecimento da mesma empresa, para distribuição.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('20','1154','Transferência para utilização na prestação de serviço','Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas nas prestações de serviços.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('21','1200','DEVOLUÇÕES DE VENDAS DE PRODUÇÃO PRÓPRIA, DE TERCEIROS OU ANULAÇÕES DE VALORES','');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('22','1201','Devolução de venda de produção do estabelecimento','Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como Venda de produção do estabelecimento.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('23','1202','Devolução de venda de mercadoria adquirida ou recebida de terceiros','Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('24','1203','Devolução de venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas foram classificadas no código 5.109 - Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('25','1204','Devolução de venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas foram classificadas no código 5.110 - Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('26','1205','Anulação de valor relativo à prestação de serviço de comunicação','Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('27','1206','Anulação de valor relativo à prestação de serviço de transporte','Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.');
