insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('259','5102','Venda de mercadoria adquirida ou recebida de terceiros','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('260','5103','Venda de produção do estabelecimento, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('261','5104','Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('262','5105','Venda de produção do estabelecimento que não deva por ele transitar','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
