insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('387','6000','SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA OUTROS ESTADOS','Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado em unidade da Federação diversa daquela do destinatário');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('388','6100','VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS','');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('389','6101','Venda de produção do estabelecimento','Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('390','6102','Venda de mercadoria adquirida ou recebida de terceiros','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('391','6103','Venda de produção do estabelecimento, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('392','6104','Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('393','6105','Venda de produção do estabelecimento que não deva por ele transitar','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('394','6106','Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('395','6107','Venda de produção do estabelecimento, destinada a não contribuinte','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, destinadas a não contribuintes. Quaisquer operações de venda destinadas a não contribuintes deverão ser classificadas neste código.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('396','6108','Venda de mercadoria adquirida ou recebida de terceiros, destinada a não contribuinte','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas a não contribuintes. Quaisquer operações de venda destinadas a não contribuintes deverão ser classificadas neste código.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('397','6109','Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('398','6110','Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('399','6111','Venda de produção do estabelecimento remetida anteriormente em consignação industrial','Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('400','6112','Venda de mercadoria adquirida ou recebida de Terceiros remetida anteriormente em consignação industrial','Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('401','6113','Venda de produção do estabelecimento remetida anteriormente em consignação mercantil','Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('402','6114','Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil','Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('403','6115','Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('404','6116','Venda de produção do estabelecimento originada de encomenda para entrega futura','Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.');
insert into CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('405','6117','Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.');
