insert into csosn_a (ID, CODIGO, DESCRICAO, OBSERVACAO) values('2','2','Simples Nacional - excesso de sublimite da receita bruta','O código 2 será preenchido pelo contribuinte optante pelo Simples Nacional mas que tiver ultrapassado o sublimite de receita bruta fixado pelo estado/DF e estiver impedido de recolher o ICMS/ISS por esse regime, conforme arts. 19 e 20 da LC 123/06.');
insert into csosn_a (ID, CODIGO, DESCRICAO, OBSERVACAO) values('3','3','Regime Normal','O código 3 será preenchido pelo contribuinte que não estiver na situação 1 ou 2.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('1','101','Tributada pelo Simples Nacional com permissão de crédito','Classificam-se neste código as operações que permitem a indicação da alíquota do ICMS devido no Simples Nacional e o valor do crédito correspondente.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('2','102','Tributada pelo Simples Nacional sem permissão de crédito','Classificam-se neste código as operações que não permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e não estejam abrangidas nas hipóteses dos códigos 103, 203, 300, 400, 500 e 900.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('3','103','Isenção do ICMS no Simples Nacional para faixa de receita bruta','Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contemplados com isenção concedida para faixa de receita bruta nos termos da Lei Complementar nº 123, de 2006.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('4','201','Tributada pelo Simples Nacional com permissão de crédito e com cobrança do ICMS por substituição tributária','Classificam-se neste código as operações que permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e com cobrança do ICMS por substituição tributária.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('5','202','Tributada pelo Simples Nacional sem permissão de crédito e com cobrança do ICMS por substituição tributária','Classificam-se neste código as operações que não permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e não estejam abrangidas nas hipóteses dos códigos 103, 203, 300, 400, 500 e 900, e com cobrança do ICMS por substituição tributária.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('6','203','Isenção do ICMS no Simples Nacional para faixa de receita bruta e com cobrança do ICMS por substituição tributária','Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contemplados com isenção para faixa de receita bruta nos termos da Lei Complementar nº 123, de 2006, e com cobrança do ICMS por substituição tributária.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('7','300','Imune','Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contempladas com imunidade do ICMS.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('8','400','Não tributada pelo Simples Nacional','Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional não sujeitas à tributação pelo ICMS dentro do Simples Nacional.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('9','500','ICMS cobrado anteriormente por substituição tributária (substituído) ou por antecipação','Classificam-se neste código as operações sujeitas exclusivamente ao regime de substituição tributária na condição de substituído tributário ou no caso de antecipações.');
insert into csosn_b (ID, CODIGO, DESCRICAO, OBSERVACAO) values('10','900','Outros','Classificam-se neste código as demais operações que não se enquadrem nos códigos 101, 102, 103, 201, 202, 203, 300, 400 e 500.');
