INSERT INTO TIPO_RELACIONAMENTO (ID, CODIGO, NOME, DESCRICAO) VALUES (2, '102', 'Filho ou enteado ate 21 anos', ' filho(a) ou enteado(a), até 21 anos de idade, ou, em qualquer idade, quando incapacitado física ou mentalmente para o trabalho');
