INSERT INTO TIPO_RELACIONAMENTO (ID, CODIGO, NOME, DESCRICAO) VALUES (5, '105', 'Irmão, Neto ou Bisneto até 24 anos', ' irmão(ã), neto(a) ou bisneto(a), sem arrimo dos pais, com idade de 21 anos até 24 anos, se ainda estiver cursando estabelecimento de ensino superior ou escola técnica de segundo grau, desde que o contribuinte tenha detido sua guarda judicial até os 21 anos');
INSERT INTO TIPO_RELACIONAMENTO (ID, CODIGO, NOME, DESCRICAO) VALUES (6, '106', 'Pais, avós e bisavós', ' pais, avós e bisavós que, em 2010, tenham recebido rendimentos, tributáveis ou não, até R$ 17.989,80');
